import React, { useState } from 'react';
import './styles.css';
export default function Flip({ Ftext, Ftitle, Btext, Btitle }) {
  const [flip, setFlip] = useState(!flip);
  return (
    <div class="flip-card">
      <div class="flip-card-inner">
        {flip ? (
          <div class="flip-card-front">
            <p class="title">{Ftitle}</p>
            <p>{Ftext}</p>
            <div>
              <button onClick={() => setFlip(!flip)}>vira</button>
            </div>
          </div>
        ) : (
          <div class="flip-card-back">
            <p class="title">{Btitle}</p>
            <p>{Btext}</p>
            <div>
              <button onClick={() => setFlip(!flip)}>vira</button>
            </div>
          </div>
        )}

      </div>
    </div>
  );
}
